      <Circle cx={12} cy={12} r={10}/>
      <Circle cx={12} cy={12} r={4}/>
      <Path d="M4.93 4.93l4.24 4.24M14.83 14.83l4.24 4.24M14.83 9.17l4.24-4.24M14.83 9.17l3.53-3.53M4.93 19.07l4.24-4.24"/>
    </Svg>);
}
export default SvgLifeBuoy;
